    render(){
      return(
        <div className="hub">

        <div className="hubheader">
          <div className="header1">          </div>
          <div className="header2">          </div>
        </div>

        <div className="hubsearchcontainer">
        <div className="hubsearchposition">
         <ChooseUni />
          Find courses, subjects and other useful stuff:
          <div className="hubsearchbar">
          SEARCH BAR
          </div>
        </div>
        </div>

        </div>
      )
    }
  }

export default Hub

class ChooseUni extends Component {
  render(){
    return(
      <div className="unichoice">
        <div className="unichoiceoption">Oxford</div>
        <div className="unichoiceoption">Cambridge</div>
        <div className="unichoiceoption">Undecided</div>
      </div>
    )
  }
}
